syntax = "proto3";

package sdc.biceps;

option java_multiple_files = true;
option java_package = "org.somda.sdc.proto.model.biceps";
option java_outer_classname = "AlertConditionPriorityProto";


message AlertConditionPriorityMsg {
  enum EnumType {
    LO = 0;
    ME = 1;
    HI = 2;
    NONE = 3;
  }
  EnumType enum_value = 1;
}
